import React, { Component } from "react";

class CoursesList extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-12">
            <h1>Courses List</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default CoursesList;
